import { Sidebar } from "../components/Sidebar";
import { UserRanked } from "../components/UserRanked";

export const Ranking = () => {
  const users = [
    {
      name: "Amet Mattis Vulputate",
      score: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "50",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "40",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "30",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
  ];

  return (
    <div className="flex min-h-screen max-w-screen w-full h-full">
      <Sidebar />

      <div className="w-4/5 flex flex-col">
        <div className="relative">
          <div className="text-3xl text-[#000000] font-monoserrat mt-8 m-8">
            Ranking
          </div>
        </div>

        <div className="flex flex-row  ml-12">
          <strong className="font-montserrat ml-8 self-start">Name</strong>
          <p className="font-montserrat mr-8 position-absolute">Rating</p>
        </div>

        {users.map((item) => {
          return <UserRanked name={item.name} score={item.score} />;
        })}
      </div>
    </div>
  );
};
